  const [store, setStore] = useContext(StoreContext);
  const j = Object.values(store);
  const [jokeCount, setJokeCount] = useState(0)
  useEffect(() => {
    //hae kategoriat jsonilla

    setJokeCount(jokeCount + j.length)

  }, []);

  return(
    <div style={{backgroundColor:"green"  }}>
      <h3>vitsit</h3>
      <p>pöö</p>
        {j.map((element, i) => {
            console.log(element["joke"])
            
            return <li key={i}>{i + 1}{". "}{element["joke"]}{" ---------------ja kategory on testissä   "}{element["categories"]}{"\n"}</li>
          })
        
        }
      
      
      
      
      
      
      <p>pöö</p>
      <p>{"vitsejä on: "+jokeCount}</p>
    </div>
  )
}
export default PrintJokes;
